const e=JSON.parse('{"key":"v-60e6bd33","path":"/overview/java-history.html","title":"Java发展简史","lang":"zh-CN","frontmatter":{"title":"Java发展简史","shortTitle":"Java发展简史","category":["Java核心"],"tag":["Java概述"],"description":"Java程序员进阶之路，小白的零基础Java教程，Java发展简史","head":[["meta",{"name":"keywords","content":"Java,Java SE,Java基础,Java教程,Java程序员进阶之路,Java入门,教程,Java简史"}],["meta",{"property":"og:url","content":"https://tobebetterjavaer.com/overview/java-history.html"}],["meta",{"property":"og:site_name","content":"Java程序员进阶之路"}],["meta",{"property":"og:title","content":"Java发展简史"}],["meta",{"property":"og:description","content":"Java程序员进阶之路，小白的零基础Java教程，Java发展简史"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-02-25T08:06:30.000Z"}],["meta",{"property":"article:tag","content":"Java概述"}],["meta",{"property":"article:modified_time","content":"2023-02-25T08:06:30.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Java发展简史\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-02-25T08:06:30.000Z\\",\\"author\\":[]}"]]},"headers":[],"git":{"createdTime":1627606899000,"updatedTime":1677312390000,"contributors":[{"name":"itwanger","email":"www.qing_gee@163.com","commits":14},{"name":"沉默王二","email":"www.qing_gee@163.com","commits":5}]},"readingTime":{"minutes":7.49,"words":2248},"filePathRelative":"overview/java-history.md","localizedDate":"2021年7月30日","excerpt":"<h1> 2.2 Java发展简史</h1>\\n<p>20 世纪 90 年代，单片式计算机系统诞生。单片式计算机系统不仅廉价（之前的计算机非常庞大，并且昂贵），而且功能强大，可以大幅度提升消费性电子产品的智能化程度。</p>\\n<p>Sun 公司为了抢占市场先机，在 1991 年成立了一个由詹姆斯·高斯林（James Gosling）领导的，名为“Green”的项目组，目的是开发一种能够在各种消费性电子产品上运行的程序架构。</p>\\n<p>项目组首先考虑的是采用 C++ 来编写程序，但 C++ 过于复杂和庞大，再加上消费电子产品所采用的嵌入式处理器芯片的种类繁杂，需要让编写的程序能够跨平台运行并不容易——C++ 在跨平台方面做得并不好。</p>"}');export{e as data};
